{\color{blue}\underline{POSSIBLE RULES: further decoding}\\
1. $\Delta SNR > T, \ \ T \in \mathbb{R}$\\
2. \{XDR(1), XDR(2), $\ldots$, XDR($p$)\} $\in \mathrm{XDR}_\mathrm{trg}$}

{\color{blue}
\underline{POSSIBLE RULES: relative weighting of snippets $\mathbf{x}_i$ and $\mathbf{x}_j$}\\
1. $\mathbf{x}^* = \arg \max\limits_\mathbf{x} (\mathrm{SNR}_{\mathbf{x}_i}, \mathrm{SNR}_{\mathbf{x}_j})$\\
2. $\mathbf{x}^* = \arg \max\limits_\mathbf{x} (\mathrm{SNR}_{\mathbf{x}_i}, \mathrm{SNR}_{\mathbf{x}_j}), \ \ \mathrm{iff} \ \ \mathrm{numStages}(\mathrm{XDR_{\mathbf{x}^*}}) > T, \ \ T \in \{2, 3, \ldots, P\}$
}
